// Main class for the main screen. Contains everything.
import React from "react";
import { IsbarClientProvider } from "./IsbarFhirClient";
import { IsbarSimpleApp } from "./IsbarSimpleApp";
import { BrowserRouter, Link } from "react-router-dom";

export default class Home extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            isMenu: true,
            isSimple: true
        }
    }

    render(){
        if(this.state.isMenu){
            return (
                <div>
                    <button onClick={() => this.setState({isSimple: true, isMenu: false})}>
                        simple
                    </button>

                    <button onClick={() => this.setState({isSimple: false, isMenu: false})}>
                        simple
                    </button>
                </div>
            )
        }else{
            if(this.state.isSimple){
                return(
                    <IsbarSimpleApp/>
                )
            } else{
                return(
                    <IsbarSimpleApp/>
                )
            }
        }
    }
}
